var devBlog=function(){this.init=function(){$("#tags").tooltip();this.bindEvents()};this.bindEvents=function(){$(".delete-icon").on("click",function(){var n=$(this).data("post-id");$("#postId").val(n);$("#confirmation-dialog").modal({backdrop:"static"})});$("button.delete-confirmed").on("click",function(){window.location="/Blog/Delete/?postId="+$("#postId").val()})}};$(document).ready(function(){(new devBlog).init()});